import React, { useEffect } from "react";
import './AccordionCom.scss'
import { useTranslation } from "react-i18next";
import { useParams } from "react-router-dom";

function AccordionCom ({ data, handler, type, clear,allSubCategory }) {
console.log("7all subcategory",allSubCategory);
  const { t } = useTranslation();
  var { subCat } = useParams();
  // var a=useParams();
  // console.log("a params",a.id);
console.log("subcat",subCat);
console.log("Accord data",data);
  useEffect(() => {
    if(subCat === undefined) {
      return
    } else {
      if(type === "SubCategory") {
        let sub = data?.find(d => d?.id == subCat)
        console.log("subidd==>",sub);
        handler(sub?.id)
        console.log(sub)
      }
      if(type === "Filter By") {
        let sub = data?.find(d => d?.id == subCat)
        console.log("subidd==>",sub);
        handler(sub?.id)
        console.log(sub)
      }
    }
  }, [subCat])

 var subtrue=[];

